const Login = (props) => {
  const {
    email,
    setEmail,
    password,
    setPassword,
    handleLogin,
    handleSignUp,
    hasAccount,
    setHasAccount,
    emailError,
    passwordError,
  } = props;
  return <section className="login">
      <div className="loginContainer">
          <label>Username</label>
          <input type="email" autoFocus required value={email}></input>
      </div>
  </section>;
};

export default Login;
